import React, { useState } from "react";
import { useSpring, animated } from "react-spring";
import "./Nt.module.scss"; // Import your CSS file for styling

const Nt = () => {
  const [show, setShow] = useState(false);

  const nProps = useSpring({
    from: { opacity: 0, scale: 0.5 },
    to: { opacity: 1, scale: 1 },
    config: { tension: 120, friction: 14, duration: 1000 },
    delay: 500,
  });

  const tProps = useSpring({
    from: { opacity: 0, scale: 0.5 },
    to: { opacity: 1, scale: 1 },
    config: { tension: 120, friction: 14, duration: 1000 },
    delay: 1500,
  });

  const dotProps = useSpring({
    from: { opacity: 0 },
    to: { opacity: 1 },
    config: { tension: 120, friction: 14, duration: 1000 },
    delay: 2500,
  });

  return (
    <div className="logo-container">
      <animated.svg
        xmlns="http://www.w3.org/2000/svg"
        width="120"
        height="60"
        viewBox="0 0 120 60"
      >
        <g fill="none" fillRule="evenodd">
          <animated.circle cx="30" cy="30" r="10" fill="#000">
            {(dotProps) => (
              <animated.circle
                {...dotProps}
                cx="30"
                cy="30"
                r="10"
                fill="#000"
              />
            )}
          </animated.circle>
          <animated.circle cx="60" cy="30" r="10" fill="#000">
            {(dotProps) => (
              <animated.circle
                {...dotProps}
                cx="60"
                cy="30"
                r="10"
                fill="#000"
              />
            )}
          </animated.circle>
          <animated.circle cx="90" cy="30" r="10" fill="#000">
            {(dotProps) => (
              <animated.circle
                {...dotProps}
                cx="90"
                cy="30"
                r="10"
                fill="#000"
              />
            )}
          </animated.circle>
          <animated.circle cx="90" cy="30" r="10" fill="#000">
            {(dotProps) => (
              <animated.circle
                {...dotProps}
                cx="90"
                cy="30"
                r="10"
                fill="#000"
              />
            )}
          </animated.circle>
          <animated.circle cx="110" cy="30" r="10" fill="#000">
            {(dotProps) => (
              <animated.circle
                {...dotProps}
                cx="110"
                cy="30"
                r="10"
                fill="#000"
              />
            )}
          </animated.circle>
          <animated.circle cx="110" cy="30" r="10" fill="#000">
            {(dotProps) => (
              <animated.circle
                {...dotProps}
                cx="110"
                cy="30"
                r="10"
                fill="#000"
              />
            )}
          </animated.circle>
          <animated.circle cx="110" cy="30" r="10" fill="#000">
            {(dotProps) => (
              <animated.circle
                {...dotProps}
                cx="110"
                cy="30"
                r="10"
                fill="#000"
              />
            )}
          </animated.circle>
          <animated.circle cx="110" cy="30" r="10" fill="#000">
            {(dotProps) => (
              <animated.circle
                {...dotProps}
                cx="110"
                cy="30"
                r="10"
                fill="#000"
              />
            )}
          </animated.circle>
          <animated.circle cx="110" cy="30" r="10" fill="#000">
            {(dotProps) => (
              <animated.circle
                {...dotProps}
                cx="110"
                cy="30"
                r="10"
                fill="#000"
              />
            )}
          </animated.circle>
        </g>
      </animated.svg>
      <animated.div style={nProps} className="n">
        N
      </animated.div>
      <animated.div style={tProps} className="t">
        T
      </animated.div>
    </div>
  );
};

export default Nt;
